import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'
const exclusive = (props) => (
    <div>
        <Head>
            <style amp-custom>
                {`
                .container {
                    background-color: #52bdae;
                    display: block;
                    font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                }

                .right_teal{
                    display:flex;
                }
                .left_teal{
                    display:block;
                }
                .addtocart_cardone{
                    background-color: white;
                    margin-left:30px;

                }
                .addtocart_cardtwo{
                    background-color: white;
                    margin-left:10px;
                    margin-right:30px;

                }
                .upper{
                    background-color:#e7e6e6 ;
                    margin-top:0px;
                    text-align: center;
                    font-weight: bold;
                    margin-bottom:0px;
                    color: #58595f;
                    padding: 10px 20px 0px 20px;
                    letter-spacing: 2px;
                }
                .permonth{
                    color:black;
                    text-align: center;
                    font-size: 12px;
                    color: #58595f;
                    font-weight: bold;
                    letter-spacing: 1px;
                }
                .instant_access{
                    color:black;
                    text-align: center;
                    font-size: 12px;
                    color: #58595f;
                    font-weight: bold;
                    letter-spacing: 1px;
                }
                .price{
                    background-color:#e7e6e6 ;
                    margin-top:0px;
                    text-align: center;
                    font-weight: bold;
                    margin-bottom:0px;
                    color: #58595f;
                    padding: 10px 20px 0px 10px;
                    letter-spacing: 2px;
                }
                .addtocart_button{
                    background-color:#ed3833;
                    color: white;
                    padding:8px;
                    border-radius: 6px
                    margin-left:45px;
                }
                `}
            </style>
        </Head>
        <body>
            <div class="container">
                <div class="left_teal" >
                    <p>
                        <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                        <p class="teal_banner_line2"> AT AN </p>
                        <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 

                    </p>
                </div>
                <div class="right_teal">
                    <div class="addtocart_cardone">
                            <p class="upper"> MONTHLY </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 149/- per month</p>
                            <p class="instant_access">Get instant access 
                                for a full month.</p>
                            <h3 class="price">@ Rs. 149/-</h3>  
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                    <div class="addtocart_cardtwo">
                            <p class="upper"> ANNUAL </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 25/- per month</p>
                            <p class="instant_access">Get instant access 
                                for a full year.</p>
                            <h3 class="price">@ Rs. 299/-</h3>   
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                </div>   
                </div>    
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
